import React from 'react';

const Gallery = () => {
  const galleryImages = [
    { src: '/2.jpeg', title: 'Bloc op√©ratoire', description: 'Bloc op√©ratoire moderne ü©∫' },
    { src: '/3.jpeg', title: 'Consultation', description: 'Consultation m√©dicale üßë‚Äç‚öïÔ∏è' },
    { src: '/4.jpeg', title: '√âquipe m√©dicale', description: '√âquipe m√©dicale üë®‚Äç‚öïÔ∏èüë©‚Äç‚öïÔ∏è' },
    { src: '/5.jpeg', title: 'Intervention chirurgicale', description: 'Intervention chirurgicale üî¨' },
    { src: '/6.jpeg', title: 'Salle de consultation', description: 'Salle de consultation moderne' },
    { src: '/7.jpeg', title: '√âquipement m√©dical', description: '√âquipement m√©dical de pointe' },
    { src: '/8.jpeg', title: 'Formation m√©dicale', description: 'Formation et enseignement' },
    { src: '/9.jpeg', title: 'Recherche m√©dicale', description: 'Projets de recherche' }
  ];

  return (
    <section id="gallery" className="gallery">
      <div className="container">
        <h2 className="section-title">Galerie d'images</h2>

        <div className="gallery-grid">
          {galleryImages.map((image, index) => (
            <div key={index} className="gallery-item">
              <img src={image.src} alt={image.title} />
              <div className="gallery-overlay">
                <h4>{image.title}</h4>
                <p>{image.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Gallery;
